CREATE TABLE A_ACTEUR
( 
"ACT_ID" VARCHAR2(50),
"NOM" VARCHAR2(50),
"SIRET" NUMBER(14,0),
"CATEGORIE_JURIDIQUE" VARCHAR2(20),
"CODE_NAF" VARCHAR2(10),
"CAPITAL_SOCIAL" NUMBER(18,2),
"EMAIL_RESPONSABLE" VARCHAR2(50),
"ADRESSE" VARCHAR2(100),
"TELEPHONE" VARCHAR2(50),
"STATUT" VARCHAR2(50),
"TYPE_ACTEUR" VARCHAR2(10),
"DATE_CREATION" DATE,
CONSTRAINT A_ACTEUR_PK PRIMARY KEY (ACT_ID)
);
----------------------------------------------------------
----------------------------------------------------------


CREATE TABLE A_UTILISATEUR
( 
"UTILISATEUR_ID" VARCHAR2(50),
"NOM" VARCHAR2(10),
"PRENOM" VARCHAR2(10),
"STATUT" VARCHAR2(10),
"EMAIL" VARCHAR2(50),
"UTILISATEUR_TYPE" VARCHAR2(10),
"DATECREATION" DATE,
"ACT_ID" VARCHAR2(50),
CONSTRAINT A_UTILISATEUR_PK PRIMARY KEY (UTILISATEUR_ID),
CONSTRAINT A_UTILISATEUR_ACTEUR
    FOREIGN KEY (ACT_ID)
    REFERENCES A_ACTEUR(ACT_ID)
);
----------------------------------------------------------
----------------------------------------------------------


CREATE TABLE A_DEMANDE
( 
"DEMANDE_ID" VARCHAR2(50),
"MONTANT" NUMBER(18,2),
"CREATION_DATE" DATE,
"TERME" VARCHAR2(10),
"STATUT" VARCHAR2(10),
"COMMISSION" NUMBER(18,2),
"ECHEANCE" NUMBER(18,2),
"PERIODICITE"  VARCHAR2(10),
"UTILISATEUR_ID"  VARCHAR2(50),
"FOURNISSEUR_ID"  VARCHAR2(50),
"GARANT_ID" VARCHAR2(50),
CONSTRAINT A_DEMANDE_PK PRIMARY KEY (DEMANDE_ID),
CONSTRAINT A_DEMANDE_UTILISATEUR
    FOREIGN KEY (UTILISATEUR_ID)
    REFERENCES A_UTILISATEUR(UTILISATEUR_ID),
CONSTRAINT A_DEMANDE_FOURN
    FOREIGN KEY (FOURNISSEUR_ID)
    REFERENCES A_ACTEUR(ACT_ID),
CONSTRAINT A_DEMANDE_GAR
    FOREIGN KEY (GARANT_ID)
    REFERENCES A_ACTEUR(ACT_ID)
);


