CREATE TABLE A_DOSSIER
( 
"DOSSIER_ID" VARCHAR2(50),
"MONTANT" NUMBER(18,2),
"PERIODICITE" VARCHAR2(10),
"TERME" VARCHAR2(10),
"IMPAYE" VARCHAR2(10),
"CRD" NUMBER(18,2),
"DEB_DATE" DATE,
"FIN_DATE" DATE,
CONSTRAINT A_DOSSIER_PK PRIMARY KEY (DOSSIER_ID)
);

