--------------------------------------------------------

CREATE TABLE A_ECHEANCE
( 
"ECHEANCE_ID" VARCHAR2(50),
"MONTANT" NUMBER(18,2),
"STATUT" VARCHAR2(10),
"ECHEANCE_DATE" DATE,
"DOSSIER_ID" VARCHAR2(50),
CONSTRAINT A_ECHEANCE_PK PRIMARY KEY (ECHEANCE_ID),
CONSTRAINT A_ECHEANCE_DOS
    FOREIGN KEY (DOSSIER_ID)
    REFERENCES A_DOSSIER(DOSSIER_ID)
);


